import React, { useState, useEffect } from "react";
import Card from "../../Card/Card";
import Styles from "./QuotesGrid.module.css";

export default function QuotesColumns(props) {
	const [quotes, setQuotes] = useState([]);
	useEffect(() => {
		let unmounted = false;
		fetch("http://localhost:5000/quote/id/5f1a2be8198cba0c4408e0c9", {
			method: "GET",
			headers: {
				"Content-Type": "application/json",
			},
		})
			.then((res) => {
				res.json().then((data) => {
					console.log(data.quote);
				});
			})
			.catch((err) => {
				console.log(err);
			});

		return () => {
			unmounted = true;
		};
	}, []);
	return (
		<div>
			{
				<div className={Styles.container}>
					<Card
						redirectTo="/user"
						username="Romina"
						quote="“I love you, not only for what you are, but for what I am when I am with you.”"
						tag="Love"
						quoteTittle="Love for all"
					></Card>
				</div>
			}
			{/* <Redirect to="/user"></Redirect> */}
		</div>
	);
}
